B.Qi=new A.aV("2. Leistungen des Anbieters und Funktionsweise der App",null,B.aw,null,null,null,null)
B.PO=new A.aV("2.1. Die App bietet KI-gest\xfctzte personalisierte Kindergeschichten, die durch die Eingabe von Informationen (z.B. Name, Interessen) durch die Nutzer erstellt werden. Funktionen umfassen Sprachwahl, Vorlesefunktion, Audioausgabe und das Teilen von Inhalten innerhalb der Plattform.\n2.2. Die App ist ausschlie\xdflich \xfcber den Apple App Store und Google Play Store erh\xe4ltlich.\n2.3. Der Anbieter ist bem\xfcht, die Inhalte der App sorgf\xe4ltig zu gestalten. Die mittels KI generierten Geschichten basieren auf den vom Nutzer eingegebenen Daten und Algorithmen. Der Anbieter \xfcbernimmt keine Gew\xe4hr f\xfcr die absolute Fehlerfreiheit, Richtigkeit oder Eignung der generierten Inhalte f\xfcr einen bestimmten, vom Nutzer verfolgten Zweck, \xfcber die zugesicherten Funktionen hinaus (siehe auch \xa714 Haftung).\n2.4. Der Anbieter beh\xe4lt sich das Recht vor, Funktionen der App zu \xe4ndern, zu erweitern, vor\xfcbergehend oder dauerhaft einzustellen, sofern dies den Nutzern unter Ber\xfccksichtigung der Interessen des Anbieters zumutbar ist, insbesondere wenn diese \xc4nderungen geringf\xfcgig sind oder aus technischen oder rechtlichen Gr\xfcnden erforderlich werden. Bei wesentlichen \xc4nderungen, die erworbene kostenpflichtige Leistungen betreffen, wird der Anbieter den Nutzer rechtzeitig informieren.",null,null,null,null,null,null)
