B.PP=new A.aV("6.1. Der Nutzer verpflichtet sich, bei der Eingabe von Informationen zur Erstellung von Geschichten keine rechtswidrigen, beleidigenden, rassistischen, pornografischen, gewaltverherrlichenden, diskriminierenden oder jugendgef\xe4hrdenden Inhalte zu verwenden oder zu generieren zu versuchen.\n6.2. Der Nutzer verpflichtet sich, die App nicht missbr\xe4uchlich zu nutzen, insbesondere keine Handlungen vorzunehmen, die die Sicherheit oder Funktionsf\xe4higkeit der App oder der zugrundeliegenden Systeme beeintr\xe4chtigen oder beeintr\xe4chtigen k\xf6nnten (z.B. Einschleusen von Viren, Trojanern, Denial-of-Service-Attacken).\n6.3. Es ist verboten, Zugangsdaten an Dritte weiterzugeben oder unbefugten Zugriff auf andere Nutzerkonten zu versuchen oder zu erm\xf6glichen.\n6.4. Der Nutzer stellt sicher, dass die Nutzung der App, insbesondere die Eingabe von Daten und die Verwendung der generierten Geschichten im Kontext von Kindern, stets dem Kindeswohl dient und die Aufsichtspflicht der Erziehungsberechtigten gewahrt bleibt.\n6.5. Der Nutzer stellt den Anbieter von s\xe4mtlichen Anspr\xfcchen Dritter frei, die diese aufgrund einer schuldhaften Verletzung dieser AGB oder gesetzlicher Vorschriften durch den Nutzer gegen den Anbieter geltend machen, einschlie\xdflich der angemessenen Kosten der Rechtsverteidigung.",null,null,null,null,null,null)
B.Qk=new A.aV("7. Verf\xfcgbarkeit und technische Anforderungen",null,B.aw,null,null,null,null)
B.PZ=new A.aV("7.1. Der Anbieter bem\xfcht sich um eine m\xf6glichst st\xf6rungsfreie Verf\xfcgbarkeit der App. Der Nutzer hat jedoch keinen Anspruch auf eine permanente, ununterbrochene oder fehlerfreie Nutzung. Wartungsarbeiten, Updates, technische Probleme oder andere Umst\xe4nde k\xf6nnen zu vor\xfcbergehenden Ausf\xe4llen oder Einschr\xe4nkungen f\xfchren.\n7.2. Geplante Wartungsarbeiten, die zu einer wesentlichen Unterbrechung f\xfchren, wird der Anbieter nach M\xf6glichkeit rechtzeitig ank\xfcndigen (z.B. per In-App-Benachrichtigung oder auf seiner Webseite).\n7.3. Voraussetzung f\xfcr die Nutzung der App ist ein kompatibles Endger\xe4t (Smartphone, Tablet) mit einem aktuellen Betriebssystem (iOS oder Android in den unterst\xfctzten Versionen) sowie eine aktive Internetverbindung. F\xfcr die Aktualit\xe4t und Funktionsf\xe4higkeit seiner Hard- und Software ist der Nutzer selbst verantwortlich.",null,null,null,null,null,null)
B.Qm=new A.aV("8. Datenschutz",null,B.aw,null,null,null,null)
B.Qy=new A.aV("Die Verarbeitung personenbezogener Daten erfolgt gem\xe4\xdf den geltenden Datenschutzgesetzen, insbesondere der Datenschutz-Grundverordnung (DSGVO). Es werden nur solche Daten erhoben und verarbeitet, die f\xfcr die Vertragserf\xfcllung, die Bereitstellung der App-Funktionen und die Verbesserung des Dienstes notwendig sind. Alle Daten werden DSGVO-konform \xfcber Firebase auf europ\xe4ischen Servern gespeichert. Weitere und detaillierte Informationen zur Datenverarbeitung finden sich in unserer separaten Datenschutzerkl\xe4rung, die jederzeit in der App und auf unserer Webseite [Link zu Ihrer Webseite/Datenschutzerkl\xe4rung] einsehbar ist.",null,null,null,null,null,null)
