B.Qq=new A.aV("11.1. F\xfcr unentgeltlich bereitgestellte Dienste (z.B. Testzeitraum) \xfcbernimmt der Anbieter keine Gew\xe4hrleistung, au\xdfer bei arglistig verschwiegenen M\xe4ngeln oder soweit zwingend gesetzlich vorgeschrieben.\n11.2. F\xfcr kostenpflichtig erworbene Leistungen (Credits) gelten die gesetzlichen Gew\xe4hrleistungsrechte. Der Anbieter leistet Gew\xe4hr durch Nacherf\xfcllung, d.h. nach seiner Wahl durch Mangelbeseitigung (z.B. Update) oder Ersatzlieferung (z.B. Gutschrift neuer Credits). Schl\xe4gt die Nacherf\xfcllung fehl oder ist sie unzumutbar, stehen dem Nutzer die weiteren gesetzlichen Rechte (Minderung, R\xfccktritt) zu.\n11.3. Die Gew\xe4hrleistung erstreckt sich nicht auf M\xe4ngel, die durch unsachgem\xe4\xdfe Nutzung, vom Nutzer zu vertretende fehlerhafte Eingaben, ungeeignete Hard- oder Softwareumgebung des Nutzers oder durch \xe4u\xdfere Einfl\xfcsse (z.B. St\xf6rungen der Internetverbindung) verursacht werden, es sei denn, der Anbieter hat diese zu vertreten.",null,null,null,null,null,null)
