B.Qx=new A.aV("12.1. Der Anbieter haftet unbeschr\xe4nkt f\xfcr Vorsatz und grobe Fahrl\xe4ssigkeit sowie bei Sch\xe4den aus der Verletzung des Lebens, des K\xf6rpers oder der Gesundheit.\n12.2. Bei leicht fahrl\xe4ssiger Verletzung wesentlicher Vertragspflichten (Kardinalpflichten), deren Erf\xfcllung die ordnungsgem\xe4\xdfe Durchf\xfchrung des Vertrags \xfcberhaupt erst erm\xf6glicht und auf deren Einhaltung der Nutzer regelm\xe4\xdfig vertrauen darf, ist die Haftung des Anbieters auf den vertragstypischen, vorhersehbaren Schaden begrenzt.\n12.3. Im \xdcbrigen ist eine Haftung des Anbieters f\xfcr leichte Fahrl\xe4ssigkeit ausgeschlossen.\n12.4. Die vorstehenden Haftungsbeschr\xe4nkungen gelten auch zugunsten der gesetzlichen Vertreter und Erf\xfcllungsgehilfen des Anbieters.\n12.5. Die Haftung nach dem Produkthaftungsgesetz bleibt unber\xfchrt.\n12.6. Soweit die App unentgeltlich genutzt wird (z.B. im Testzeitraum), haftet der Anbieter nur f\xfcr Vorsatz und grobe Fahrl\xe4ssigkeit sowie f\xfcr arglistig verschwiegene M\xe4ngel.\n12.7. **Haftung f\xfcr KI-generierte Inhalte:** Die mittels KI generierten Geschichten dienen der Unterhaltung. Der Anbieter \xfcbernimmt keine Gew\xe4hr f\xfcr die inhaltliche Richtigkeit, Vollst\xe4ndigkeit, Aktualit\xe4t, Sicherheit (z.B. Freiheit von unpassenden Inhalten trotz Filtermechanismen) oder Eignung der generierten Inhalte f\xfcr spezifische Zwecke des Nutzers. Die KI kann unvorhersehbare oder fehlerhafte Ergebnisse produzieren. Die Verantwortung f\xfcr die kritische Pr\xfcfung und die kindgerechte Verwendung der generierten Inhalte liegt beim Nutzer bzw. den Erziehungsberechtigten. Der Anbieter haftet nicht f\xfcr Sch\xe4den, die aus dem Vertrauen auf die Korrektheit oder Angemessenheit der KI-generierten Inhalte entstehen, es sei denn, dem Anbieter f\xe4llt Vorsatz oder grobe Fahrl\xe4ssigkeit zur Last.\n12.8. Der Anbieter haftet nicht f\xfcr Sch\xe4den aufgrund von St\xf6rungen an technischen Anlagen, die nicht in seinem Einflussbereich liegen, oder f\xfcr Datenverlust, soweit dieser nicht durch grob fahrl\xe4ssiges oder vors\xe4tzliches Handeln des Anbieters verursacht wurde und der Nutzer f\xfcr eine angemessene Datensicherung Sorge getragen hat.",null,null,null,null,null,null)
B.Q9=new A.aV("13. \xc4nderungen der AGB",null,B.aw,null,null,null,null)
B.PS=new A.aV("13.1. Der Anbieter beh\xe4lt sich das Recht vor, diese AGB jederzeit mit Wirkung f\xfcr die Zukunft zu \xe4ndern, sofern dies aufgrund ge\xe4nderter Rechtslage, technischer Entwicklungen oder zur Anpassung an neue Funktionen oder Dienste erforderlich ist und den Nutzer nicht unangemessen benachteiligt.\n13.2. \xdcber \xc4nderungen wird der Nutzer mindestens vier (4) Wochen vor Inkrafttreten in geeigneter Weise informiert (z.B. per E-Mail an die hinterlegte Adresse oder durch eine In-App-Benachrichtigung). Die ge\xe4nderten AGB werden dem Nutzer dabei zug\xe4nglich gemacht.\n13.3. Widerspricht der Nutzer den ge\xe4nderten AGB nicht innerhalb von vier (4) Wochen nach Zugang der \xc4nderungsmitteilung und nach M\xf6glichkeit der Kenntnisnahme, gelten die ge\xe4nderten AGB als angenommen. Der Anbieter wird den Nutzer in der \xc4nderungsmitteilung gesondert auf die Bedeutung seines Schweigens und die Widerspruchsfrist hinweisen.\n13.4. Im Falle eines fristgerechten Widerspruchs des Nutzers ist der Anbieter berechtigt, den Nutzungsvertrag zum Zeitpunkt des Inkrafttretens der geplanten \xc4nderung zu k\xfcndigen. Anspr\xfcche des Nutzers wegen einer solchen K\xfcndigung sind ausgeschlossen.",null,null,null,null,null,null)
B.Qc=new A.aV("14. Online-Streitbeilegung und Verbraucherschlichtung",null,B.aw,null,null,null,null)
B.Qf=new A.aV("14.1. Die Europ\xe4ische Kommission stellt eine Plattform zur Online-Streitbeilegung (OS) bereit, die Sie unter http://ec.europa.eu/consumers/odr/ finden. Verbraucher haben die M\xf6glichkeit, diese Plattform f\xfcr die Beilegung ihrer Streitigkeiten zu nutzen.\n14.2. Unsere E-Mail-Adresse lautet:  info@kinderstory.app\n14.3. Der Anbieter ist nicht verpflichtet und nicht bereit, an Streitbeilegungsverfahren vor einer Verbraucherschlichtungsstelle teilzunehmen.",null,null,null,null,null,null)
B.Qt=new A.aV("15. Schlussbestimmungen",null,B.aw,null,null,null,null)
B.Qd=new A.aV("15.1. Es gilt das Recht der Bundesrepublik Deutschland unter Ausschluss des UN-Kaufrechts (CISG). Wenn der Nutzer Verbraucher ist und seinen gew\xf6hnlichen Aufenthalt in einem anderen Land hat, bleiben zwingende Verbraucherschutzbestimmungen dieses Landes von der Rechtswahl unber\xfchrt.\n15.2. Sofern der Nutzer Kaufmann im Sinne des Handelsgesetzbuches, juristische Person des \xf6ffentlichen Rechts oder \xf6ffentlich-rechtliches Sonderverm\xf6gen ist, oder keinen allgemeinen Gerichtsstand in Deutschland hat, ist ausschlie\xdflicher Gerichtsstand f\xfcr alle Streitigkeiten aus oder im Zusammenhang mit diesem Vertrag Frankfurt am Main. Gegen\xfcber Verbrauchern mit Wohnsitz in der EU kann auch das Recht am Wohnsitz des Verbrauchers anwendbar sein und Gerichtsst\xe4nde an deren Wohnsitz bestehen.\n15.3. Sollten einzelne Bestimmungen dieser AGB ganz oder teilweise unwirksam oder undurchf\xfchrbar sein oder werden, ber\xfchrt dies die Wirksamkeit der \xfcbrigen Bestimmungen nicht. Anstelle der unwirksamen oder undurchf\xfchrbaren Bestimmung gilt eine wirksame und durchf\xfchrbare Regelung als vereinbart, die dem wirtschaftlichen Zweck der unwirksamen oder undurchf\xfchrbaren Bestimmung am n\xe4chsten kommt. Entsprechendes gilt f\xfcr den Fall einer Regelungsl\xfccke.",null,null,null,null,null,null)
